-- ----------------------------
-- Trigger structure for tambah_siswa
-- ----------------------------
DELIMITER ;;
CREATE TRIGGER `tambah_siswa` AFTER INSERT ON `tbl_siswa` FOR EACH ROW UPDATE tbl_rombel SET jumlah_siswa = jumlah_siswa+1 WHERE kode_rombel = NEW.kode_rombel;;
DELIMITER ;

-- ----------------------------
-- Trigger structure for hapus_siswa
-- ----------------------------
DELIMITER ;;
CREATE TRIGGER `hapus_siswa` AFTER DELETE ON `tbl_siswa` FOR EACH ROW UPDATE tbl_rombel SET jumlah_siswa = jumlah_siswa - 1 WHERE kode_rombel = OLD.kode_rombel;;
DELIMITER ;
